import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 80vh;
`;

const Home = () => {
  return <HomeContainer>Welcome to My Website!</HomeContainer>;
};

export default Home;
